import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import './App.css';
import Login from "./pages/Login";
import Home from "./pages/Home";
import User from "./components/User";
import Geo from "react-geolocated";
import passport from "passport";

function isLoggedIn(req, res, next) {
  console.log(req);
  if (req.isAuthenticated()){
    return true;
  } else {
    return false;
  }
};

const App = prop => (
  <Router>
    <div>
      {/* <Geo/> */}
        <Switch>
          {isLoggedIn() ? (<Route exact path="/home" component={Home}/>) : <Route path="/" component={Login}/>}
          <Route path="/:id" component={Login}/>
          <Route path="/" component={Login}/>
          {/* {hasRole(user, ["user"]) && <Route exact path="/" Component={<Wrapper/>}/>} */}
          {/* {!hasRole(user, ["user"]) && <Route path="/" Component={<UserLogin/>}/>}  */}
        </Switch>
    </div>
  </Router>
)
export default App;
